import { authService } from "FB";
import React from "react";
import { useHistory } from "react-router";

export default () => {
    const history = useHistory();
    const onLogOutClick = () => {
        authService.signOut();
        history.push("/");
        isLoggedIn = false;
    };

    return (
        <>
            <button onClick={onLogOutClick}>Log Out</button>
        </>
    );
};
